import { NgModule } from "@angular/core";
import { BrowserModule } from "@angular/platform-browser";
import { AppComponent } from "./app.component";
import { StudentsListComponent } from './students-list/students-list.component';
import { SingleStudentDetailsComponent } from './single-student-details/single-student-details.component';
import { FormsModule } from '@angular/forms';
import { ReactiveFormsModule } from "@angular/forms";
import { TestComponent } from './test/test.component';
import { studentService } from "./studentService.service";

@NgModule(
    {declarations:[AppComponent, StudentsListComponent, SingleStudentDetailsComponent, TestComponent],
    imports:[BrowserModule,FormsModule,ReactiveFormsModule],
    bootstrap:[AppComponent],
    providers:[studentService]
})

export class AppModule{

}
